import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View, Image } from "react-native";
import { Ionicons } from "@expo/vector-icons";

export default function Details({ navigation, route }) {
  return (
    <View style={{ flex: 1, paddingVertical: 50, backgroundColor: "#E6E9E8" }}>
      <View
        style={{
          flexDirection: "row",
          justifyContent: "space-between",
          marginHorizontal: 30,
        }}
      >
        <Ionicons
          name="arrow-back-sharp"
          onPress={() => navigation.goBack()}
          size={20}
          color="black"
        />
        <Ionicons name="menu-outline" size={20} color="black" />
      </View>

      <View style={{ width: "100%", alignItems: "center" }}>
        <Image
          source={require("../images/neko.jpg")}
          style={{ height: 400, width: 500 }}
        />
      </View>

      <View
        style={{
          width: "100%",
          flexDirection: "row",
          justifyContent: "space-around",
          marginVertical: 10,
        }}
      >
        <View
          style={{
            height: 110,
            width: 110,
            backgroundColor: "#fff",
            borderRadius: 35,
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <Image
            style={{ height: 50, width: 50, marginVertical: 5 }}
            source={require("../images/blue.png")}
          />
          <Text>Blue </Text>
        </View>
        <View
          style={{
            height: 110,
            width: 110,
            backgroundColor: "#fff",
            borderRadius: 35,
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <Image
            style={{ height: 50, width: 50, marginVertical: 5 }}
            source={require("../images/red.png")}
          />
          <Text>Red </Text>
        </View>

        <View
          style={{
            height: 110,
            width: 110,
            backgroundColor: "#fff",
            borderRadius: 35,
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <Image
            style={{ height: 50, width: 50, marginVertical: 5 }}
            source={require("../images/pink.png")}
          />
          <Text>Pink</Text>
        </View>
      </View>
      <View
        style={{
          justifyContent: "flex-end",
          alignItems: "center",
        }}
      >
        <View
          style={{
            height: 270,
            width: "100%",
            backgroundColor: "#fff",
            top: 50,
            borderRadius: 40,
            paddingHorizontal: 30,
            paddingVertical: 20,
          }}
        >
          <Text>{route.params.details.title}</Text>
        </View>
      </View>
    </View>
  );
}
